TRUNCATE TABLE pim_batch RESTART IDENTITY;

-- Insert batch #1

-- RESET ESTABLISHMENTS PK AND SEQUENCE COUNT
SELECT MAX(id) pim_batch_max_id FROM pim_batch;
SELECT nextval('pim_batch_id_seq') AS pim_batch_nextval;
SELECT setval('pim_batch_id_seq', (SELECT MAX(id) FROM pim_batch)) AS pim_batch_setval;
SELECT setval('pim_batch_id_seq', COALESCE((SELECT MAX(id)+1 FROM pim_batch), 1), false) AS pim_batch_val;
